import React, { Component } from 'react';
import BarChart from 'react-easy-bar-chart';
import './App.css';

class App extends Component {
  render() {
  const data = [
    {
      title:  "owners",
      value: 10,
      color: "#196f3d",
    },
    {
      title:  "drivers",
      value: 14,
      color: "#a93226",
    },


    ];
    return (
      <div className="App">
        <header className="App-header">
          <h1>React Bar Chart!</h1>
        </header>
        <BarChart 
          xAxis='React Bar Chart'
          yAxis="Values"
          height={400}
          width={800}
          data={data}
        />
      </div>
    );
  }
}

export default App;
